rint(a,n);\r\n}'),(1112,'#include <stdio.h>\r\n#include <string.h>  \r\n\r\nint main() {\r\n    char str[101];  // 최대 100글자 + \'\\0\' 널문자 포함해서 101칸\r\n\r\n    // 공백 포함해서 한 줄 입력 받기\r\n    fgets(str, sizeof(str), stdin);\r\n\r\n    // 문자열 길이 구하기 (개행 문자 \'\\n\' 제거 전)\r\n    int len = strlen(str);\r\n\r\n    // 줄 끝에 \'\\n\' 있으면 제거\r\n    if (str[len - 1] == \'\\n\') {\r\n        str[len - 1] = \'\\0\';\r\n        len--;  // 길이도 1 줄여야 해요\r\n    }\r\n\r\n    // 마지막 문자: str[len - 1]\r\n    printf(\"%d %c\\n\", len, str[len - 1]);\r\n\r\n    return 0;\r\n}\r\n'),(1113,'#include <stdio.h>\r\n#include <string.h>  \r\n\r\nint main() {\r\n    char str[101];\r\n\r\n    fgets(str, sizeof(str), stdin);\r\n\r\n    int len = strlen(str);\r\n\r\n    if (str[len - 1] == \'\\n\') {\r\n        str[len - 1] = \'\\0\';\r\n        len--; \r\n    }\r\n\r\n    printf(\"%d %c\\n\", len, str[len - 1]);\r\n\r\n    return 0;\r\n}\r\n'),(1114,'#include <stdio.h>\r\n#include <string.h>  \r\n\r\nint main() {\r\n    char str[101];\r\n\r\n\r\n    fgets(str, sizeof(str), stdin);\r\n\r\n    int len = strlen(str);\r\n\r\n    if (str[len - 1] == \'\\n\') {\r\n        str[len - 1] = \'\\0\';\r\n        len--;  // 길이도 1 줄여야 해요\r\n    }\r\n\r\n    printf(\"%d %c\\n\", len, str[len - 1]);\r\n\r\n    return 0;\r\n}\r\n'),(1115,'#include <stdio.h>\r\n#include <string.h>  \r\n\r\nint main() {\r\n    char str[101];\r\n    fgets(str, sizeof(str), stdin);\r\n\r\n    int len = strlen(str);\r\n\r\n    if (str[len - 1] == \'\\n\') {\r\n        str[len - 1] = \'\\0\';\r\n        len--;\r\n    }\r\n\r\n    printf(\"%d %c\\n\", len, str[len - 1]);\r\n\r\n    return 0;\r\n}'),(1116,'#include <stdio.h>\r\n#include <string.h>  \r\n\r\nint main() {\r\n    char str[101];\r\n\r\n    fgets(str, sizeof(str), stdin);\r\n\r\n\r\n    int len = strlen(str);\r\n\r\n    if (str[len - 1] == \'\\n\') {\r\n        str[len - 1] = \'\\0\';\r\n        len--;\r\n    }\r\n\r\n    printf(\"%d %c\\n\", len, str[len - 1]);\r\n\r\n    return 0;\